import './App.css';
import About from './components/About/About';
import Contact from './components/Contact/Contact';
import FAQ from './components/FAQ/FAQ';
import Footer from './components/Shared/Footer/Footer';
import Home from './components/Home/Home';
import NavBar from './components/Shared/NavBar/NavBar';
import ScrollToTop from './components/Shared/ScrollToTop';
import Terms from './components/Terms/Terms';
import Privacy from './components/Privacy/Privacy';
import ErrorPage from './components/404/404';

import { Helmet } from 'react-helmet';
import { BrowserRouter, Switch, Route } from 'react-router-dom';

const structuredDataJson = {
  "@context": "http://schema.org",
  "@type": "Organization",
  "name": "erthos",
  "url": "https://www.erthos.ca",
  "sameAs": [
    "https://www.instagram.com/planeterthos/",
    "https://twitter.com/planeterthos/",
    "https://www.linkedin.com/company/erthosinc/"
  ],
  "address": {
    "@type": "PostalAddress",
    "addressCountry": "CA",
    "addressLocality": "Mississauga",
    "addressRegion": "Ontario",
    "postalCode": "L4W 4M8",
    "streetAddress": "Unit 5, 2735 Matheson Blvd. E"
  }
};

function App() {
  return (
    <>
      <Helmet>
        <script className='structured-data-list' type="application/ld+json">{JSON.stringify(structuredDataJson)}</script>
      </Helmet>

      <BrowserRouter>
        <ScrollToTop />

        <div className='app'>
          <NavBar />

          <Switch>
            <Route exact component={Home} path='/' />
            <Route exact component={About} path='/about' />
            <Route exact component={Contact} path='/contact' />
            <Route exact component={FAQ} path='/faq' />
            <Route exact component={Terms} path='/terms' />
            <Route exact component={Privacy} path='/privacy' />
            <Route component={ErrorPage} />
          </Switch>

          <Footer />
        </div>
      </BrowserRouter>
    </>
  );
}

export default App;
